import React from "react";
import { NativeBaseProvider } from "native-base";
import {
  Banner,
  IconContainer,
  InnerContainer,
  StyledButton,
  StyledContainer,
  BannerLogo,
  BannerTitle,
  TransparentButton,
  SimpleButtonText,
  ItemText,
  SubTitle,
  PageHeader,
  RightIcon,
  StyledFormArea,
  StyledInputLabel,
  StyledTextInput,
  LeftIcon
} from "../components/styles";
import {
  SafeAreaView,
  StatusBar,
  TouchableOpacity,
  View,
  Text,
} from "react-native";
import { Formik } from "formik";
import { ButtonText, Line } from "../components/styles";
import { Octicons, FontAwesome5 } from "@expo/vector-icons";
import { Colors, PageTitle } from "../components/styles";

import { NavigationContainer } from "@react-navigation/native";
import { createDrawerNavigator } from "@react-navigation/drawer";
import Login from "./Login";
import KeyboardAvoidingWrapper from "../components/KeyboardAvoidingWrapper";

const { primary, brand, tertiary, darkLight, red } = Colors;

const UpdateAddress = ({navigation}) => {
  return (
    <NativeBaseProvider>
      <KeyboardAvoidingWrapper>
      <StyledContainer>
        <StatusBar style="dark" />
        <InnerContainer>
          <Banner>
            <BannerLogo
              resizeMode="cover"
              source={require("./../assets/img/page_logo.png")}
            />
            <BannerTitle
              resizeMode="cover"
              source={require("./../assets/img/page_title.png")}
            />
          </Banner>
          <PageHeader>Change Local Mailing Address</PageHeader>
          <Line></Line>

          <Formik
            initialValues={{
              address: "",
            }}
            onSubmit={(values) => {
              values = { ...values };
              console.log(values);
            }}
          >
            {({ handleChange, handleBlur, handleSubmit, values }) => (
              <StyledFormArea>
                <MyTextInput
                  value={values.address}
                  label="Room/Floor/Unit No./Building Name"
                  icon="location"
                  placeholder="123 4F Unit 203 Sky Bldg."
                  placeholderTextColor={darkLight}
                  onChangeText={handleChange("address")}
                  onBlur={handleBlur("address")}
                />
                <MyTextInput
                  value={values.address}
                  label="House No./Lot & Block No/Street"
                  icon="location"
                  placeholder="Blk 1 Lot 1 GrayHat St."
                  placeholderTextColor={darkLight}
                  onChangeText={handleChange("address")}
                  onBlur={handleBlur("address")}
                />
                <MyTextInput
                  value={values.address}
                  label="Barangay"
                  icon="location"
                  placeholder="Brgy. 101"
                  placeholderTextColor={darkLight}
                  onChangeText={handleChange("address")}
                  onBlur={handleBlur("address")}
                />
                <MyTextInput
                  value={values.address}
                  label="City/Municipality"
                  icon="location"
                  placeholder="Sta. Rosa, Laguna"
                  placeholderTextColor={darkLight}
                  onChangeText={handleChange("address")}
                  onBlur={handleBlur("address")}
                />
                
                <StyledButton onPress={handleSubmit}>
                  <ButtonText>Submit</ButtonText>
                </StyledButton>
                <StyledButton onPress={() => navigation.navigate("UpdateInformation")} style={{backgroundColor: red}}>
                  <ButtonText>Cancel</ButtonText>
                </StyledButton>
              </StyledFormArea>
            )}
          </Formik>
        </InnerContainer>
      </StyledContainer>
      </KeyboardAvoidingWrapper>
    </NativeBaseProvider>
  );
};

const MyTextInput = ({ label, icon, ...props }) => {
  return (
    <View>
      <LeftIcon>
        <Octicons name={icon} size={30} color={tertiary} />
      </LeftIcon>
      <StyledInputLabel>{label}</StyledInputLabel>
      <StyledTextInput {...props} />
    </View>
  );
};

export default UpdateAddress;
